// SPDX-License-Identifier: MIT

pragma solidity >0.7.0 <0.9.0;

import "./Medicine.sol";

interface IPrescription {
     function addMedicine(
        string calldata _name,
        uint32 _quantity,
        uint8 _dosing,
        uint8 _strength,
        uint8 _duration
    ) external;
} 

contract Prescription is IPrescription {


    struct Patient {
        uint256 ID;
        address prescriptionOwner;
    }


    struct Medicine {
        uint256 ID;
        string name;
        uint32 quantity;
        uint8 dosing;
        uint8 strength;
        uint8 duration;
    }

    mapping(address => Patient) patients;

    Medicine[] public medicines;

    function addMedicine(
        string calldata _name,
        uint32 _quantity,
        uint8 _dosing,
        uint8 _strength,
        uint8 _duration
    ) override external {

        Medicine memory medicine;

        medicine.name = _name;
        medicine.quantity = _quantity;
        medicine.dosing = _dosing;
        medicine.strength = _strength;
        medicine.duration = _duration;

        medicines.push(medicine);

    }
}

